import React from 'react';
import Logo from '../../img/logo12123.png';
import classes from "./Header.module.css";
import Login from '../../img/pngwing.com.png'

const Header = () => {
    return (
        <header className='bg-zinc-300 max-w-full h-72px'>
            <div className='max-w-screen-xl	flex justify-between mx-auto'>
                <div className='flex items-center	'>
                    <img className='w-13 h-13 mr-1' src={Logo} alt=""/>
                    <a  href='#' className='text-2xl font-bold'>ProSearch</a>
                </div>
                <div className='flex items-center	'>
                    <a className='text-xl' href='#'>Створити замовлення</a>
                </div>
                <div className='flex items-center	'>
                    <input className='py-1 px-2 w-350px h-50px outline-none	rounded-s-lg' type="text" name="" id=""/>
                    <button className='bg-amber-100	py-1 px-2 rounded-r-lg'>Знайти фахівця</button>
                </div>
                <div className='flex items-center	'>
                    <img className='w-12 h-12 mr-1' src={Login} alt=""/>
                    <a className='text-lg' href='#'>Вхід та реєстрація</a>
                </div>
            </div>
        </header>
    );
};

export default Header;
